function Logo(logo) {
  this.width = logo[0];
  this.height = logo[1]
  this.logoData = logo[2];
}

Logo.prototype.getCoords = function() {
  var logoCoords = [];

  for(var r = 0; r < this.height; r++) {
    for(var c = 0; c < this.width; c++) {
      if(this.logoData[r*this.width+c] == 1)
        logoCoords.push([0 + c,20 + r]);
    }
  }

  return logoCoords;
};

Logo.prototype.getTotalPixels = function() {
  var count = 0;

  for(var i = 0; i < this.logoData.length; i++) {
    if(this.logoData[i] == 1) count++;
  }

  return count;
};

